import React, { useState, useEffect } from "react";
import axios from "axios";

function CompetitorAnalysis() {
  const [username, setUsername] = useState("");
  const [channelData, setChannelData] = useState(null);
  const [videos, setVideos] = useState([]);
  const [keywordAnalysis, setKeywordAnalysis] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // âœ… **Function to Fetch Competitor Videos & Keywords**
  const fetchVideos = async () => {
    setLoading(true);
    setError(null);

    try {
      console.log(`Fetching videos for username: ${username}`);
      
      const response = await axios.post("http://localhost:5000/analyze", {
        username,
      });

      console.log("Response Data:", response.data);

      if (!response.data || response.data.error) {
        throw new Error(response.data?.error || "No data received from server.");
      }

      setChannelData(response.data.channelData || {});
      setVideos(response.data.videos || []);
      setKeywordAnalysis(response.data.keywordAnalysis || {});
      
    } catch (err) {
      console.error("Error fetching data:", err);
      setError("Failed to fetch data. Check the username and API.");
    }

    setLoading(false);
  };

  return (
    <div style={{ padding: "20px", fontFamily: "Arial" }}>
      <h2>Competitor Video Analysis</h2>
      <input
        type="text"
        placeholder="Enter Competitor's Channel Name"
        value={username}
        onChange={(e) => setUsername(e.target.value)}
        style={{ padding: "8px", marginRight: "10px" }}
      />
      <button onClick={fetchVideos} style={{ padding: "8px" }}>
        Get Videos
      </button>

      {loading && <p>Loading...</p>}
      {error && <p style={{ color: "red" }}>{error}</p>}

      {channelData && (
        <div>
          <h3>Channel: {channelData.title}</h3>
          <p>Subscribers: {channelData.subscriberCount}</p>
        </div>
      )}

      <ul>
        {videos.length > 0 ? (
          videos.map((video) => (
            <li key={video.videoId}>
              <a
                href={`https://www.youtube.com/watch?v=${video.videoId}`}
                target="_blank"
                rel="noopener noreferrer"
              >
                {video.title}
              </a>
              <p>
                Views: {video.views} | Likes: {video.likes} | Comments: {video.comments}
              </p>
            </li>
          ))
        ) : (
          <p>No videos found.</p>
        )}
      </ul>

      {keywordAnalysis && (
        <div>
          <h3>Keyword Analysis</h3>
          <p>
            <strong>Top Keywords:</strong>{" "}
            {keywordAnalysis.keywords?.length > 0
              ? keywordAnalysis.keywords.join(", ")
              : "No data available"}
          </p>
          <p>
            <strong>Top Bigrams:</strong>{" "}
            {keywordAnalysis.bigrams?.length > 0
              ? keywordAnalysis.bigrams.join(", ")
              : "No data available"}
          </p>
          <p>
            <strong>Top Trigrams:</strong>{" "}
            {keywordAnalysis.trigrams?.length > 0
              ? keywordAnalysis.trigrams.join(", ")
              : "No data available"}
          </p>
          <p>
            <strong>TF-IDF Scores:</strong>{" "}
            {keywordAnalysis.tfidfScores
              ? JSON.stringify(keywordAnalysis.tfidfScores)
              : "No data available"}
          </p>
          <p>
            <strong>Sentiment Score:</strong>{" "}
            {keywordAnalysis.avgSentiment !== undefined
              ? keywordAnalysis.avgSentiment
              : "No data available"}
          </p>
          <p>
            <strong>Trending Keywords:</strong>{" "}
            {keywordAnalysis.trendingKeywords?.length > 0
              ? keywordAnalysis.trendingKeywords.join(", ")
              : "No data available"}
          </p>
          <p>
            <strong>Suggested Title:</strong>{" "}
            {keywordAnalysis.suggestedTitle || "No suggestion available"}
          </p>
          <p>
            <strong>Suggested Tags:</strong>{" "}
            {keywordAnalysis.suggestedTags?.length > 0
              ? keywordAnalysis.suggestedTags.join(", ")
              : "No suggestions available"}
          </p>
        </div>
      )}
    </div>
  );
}

export default CompetitorAnalysis;
